import classes from './Input.module.css'

let InputArea = (props) => {
    return(
        <div className={classes.wrapper}>
            <div className={classes.inputarea}>
                <input className={classes.inputarea__button} type="text" placeholder='Enter new case' />
                <button className='input-area__button'>+ Add case</button>
            </div>
        </div>
    );
}

export default InputArea;
